import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Try to find the first visible "Electronics" category link or card
    // 1. Try category card (prefer prominent navigation)
    let categoryCardSelector = '.category-card:has-text("Electronics")';
    let found = false;
    let extractedData = {};

    try {
      await page.waitForSelector(categoryCardSelector, { timeout: 5000 });
      await page.click(categoryCardSelector);
      found = true;
      // Wait for main content update (simulate navigation)
      await page.waitForSelector('h2', { timeout: 5000 });
      // Extract the heading text to verify navigation
      const heading = await page.textContent('h2');
      extractedData = { navigatedHeading: heading };
      await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));
    } catch (err) {
      // If not found, try to click the first "Electronics" link (fallback)
      const electronicsLinkXPath = '//a[normalize-space(text())="Electronics"]';
      try {
        await page.waitForSelector('xpath=' + electronicsLinkXPath, { timeout: 5000 });
        const [link] = await page.$$('xpath=' + electronicsLinkXPath);
        if (link) {
          await link.click();
          found = true;
          // Wait for any visible change (e.g., main content or focus)
          await page.waitForTimeout(500); // fallback, as link may not update content
          await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_link.png') });
          screenshots.push(path.join(screenshotsDir, 'step_2_electronics_link.png'));
          extractedData = { clickedLinkText: await link.textContent() };
        }
      } catch (err2) {
        // If still not found, fail gracefully
        return {
          success: false,
          action: "Failed to navigate to Electronics category",
          extractedData: {},
          screenshots,
          error: "Could not find Electronics category card or link"
        };
      }
    }

    return {
      success: found,
      action: "Navigated to Electronics category",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
